import React from 'react';
import { Route } from 'react-router-dom';
import Leftbar from '../components/Leftbar';

export const LayoutRoute = ({ title, children, ...props } : {title: string, children: any, props: props}) => {

  return (
    <Route {...props}>
      <div>
        <Leftbar />
        {children}
      </div>
    </Route>
  )
}

export const BaseRoute = ({ title, children, ...props } : {title: string, children: any}) => {

  return (
    <Route {...props}>
      {children}
    </Route>
  )
}
